ENCODED_SCRIPT = """"""

import base64
from Cryptodome.Cipher import AES
import marshal
KEY = b'f83g200fk03kdlh7'
IV = b'h50hkkepf39ggsvs'

def decrypt_aes(encrypted_text, key, iv):
    cipher = AES.new(key, AES.MODE_CBC, iv)
    decrypted = cipher.decrypt(base64.b64decode(encrypted_text))
    pad = decrypted[-1]
    return decrypted[:-pad].decode()

# Giải mã lớp 2 (AES)
decoded_base64 = decrypt_aes(ENCODED_SCRIPT, KEY, IV)

# Giải mã lớp 1 (Base64)
original_code = base64.b64decode(decoded_base64).decode()

# Chạy trực tiếp code đã giải mã
exec(original_code)
